import React from "react";
import logo from "../../assets/images/logo.png";
const Navbar = () => {
  return (
    <>
      <nav className="flex items-center justify-between px-4 py-3">
        <div className="w-10 h-10 absolute top-6 left-6">
          <img className="text-white font-bold" src={logo} alt="logo" />
        </div>
        {/* Join Waitlist Button */}
        <button className="absolute top-6 right-6 bg-white text-black [font:sans-serif] font-semibold py-2 px-6 rounded-full shadow-md hover:bg-gray-200 transition">
          Join Waitlist
        </button>
        <div class="flex flex-col justify-start shrink-0 opacity-100">
          <p class="font-bold text-[14px] leading-[14.02px] tracking-[-0.02em]">
            Join Waitlist
          </p>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
